import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import {
  Box,
  Container,
  Typography,
  Grid,
  Paper,
  Divider,
} from "@material-ui/core";
const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      margin: theme.spacing(1),
    },
  },
}));

export default function ContainedButtons() {
  const classes = useStyles();

  return (
    <Grid
      container
      style={{
        maxWidth: "1170px",
        minHeight: "100vh",
        paddingTop: "140px",
        marginLeft: "170px",
      }}
    >
      <Grid item md={2}></Grid>
      <Grid item md={8} style={{ marginLeft: "30px" }}>
        <Paper style={{ height: "75vh" }}>
          <Container style={{ padding: "40px" }}>
            {" "}
            <Grid container>
              <Grid item md={5} style={{ marginTop: "30px" }}>
                {/* FIXME: Color of text fields */}
                <TextField
                  name="fullName"
                  onChange={handleChange}
                  onBlur={handleBlur}
                  error={errors.fullName && touched.fullName}
                  helperText={
                    errors.fullName && touched.fullName ? errors.fullName : null
                  }
                  label="Full Name"
                  variant="outlined"
                  size="small"
                  style={{ color: "#3E2672" }}
                  fullWidth
                />

                <TextField
                  id="outlined-basic"
                  name="mobileNumber"
                  onChange={handleChange}
                  onBlur={handleBlur}
                  error={errors.mobileNumber && touched.mobileNumber}
                  helperText={
                    errors.mobileNumber && touched.mobileNumber
                      ? errors.mobileNumber
                      : null
                  }
                  label=""
                  variant="outlined"
                  size="small"
                  style={{ color: "#05B890" }}
                  fullWidth
                />

                {/* FIXME: Color of text fields */}
                <TextField
                  label=""
                  name="password"
                  onChange={handleChange}
                  type="password"
                  value={values.password}
                  onBlur={handleBlur}
                  fullWidth
                  variant="outlined"
                  error={errors.password && touched.password}
                  helperText={
                    errors.password && touched.password ? errors.password : null
                  }
                />
              </Grid>
              <Grid item md={1} />
              <Grid item md={5} style={{ marginTop: "30px" }}>
                {/* FIXME: Color of text fields */}
                <TextField
                  id="outlined-basic"
                  label=""
                  type="email"
                  name="email"
                  onChange={handleChange}
                  onBlur={handleBlur}
                  error={errors.email && touched.email}
                  helperText={
                    errors.email && touched.email ? errors.email : null
                  }
                  variant="outlined"
                  size="small"
                  style={{ color: "#3E2672" }}
                  fullWidth
                />

                <TextField
                  id="outlined-basic"
                  name="cnic"
                  onChange={handleChange}
                  onBlur={handleBlur}
                  error={errors.cnic && touched.cnic}
                  helperText={errors.cnic && touched.cnic ? errors.cnic : null}
                  label=""
                  variant="outlined"
                  size="small"
                  style={{ color: "#05B890" }}
                  fullWidth
                />

                <TextField
                  label=""
                  name="confirmPassword"
                  onChange={handleChange}
                  type="password"
                  value={values.confirmPassword}
                  onBlur={handleBlur}
                  fullWidth
                  variant="outlined"
                  error={errors.confirmPassword && touched.confirmPassword}
                  helperText={
                    errors.confirmPassword && touched.confirmPassword
                      ? errors.confirmPassword
                      : null
                  }
                />
              </Grid>

              <Grid container item md={12} style={{ alignContent: "center" }}>
                <Button
                  title="Create Account"
                  variant="textButton"
                  onClick={handleSubmit}
                  style={{
                    marginTop: "20px",
                    marginLeft: "230px",

                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    minWidth: "200px",
                    height: "auto",
                    border: "0",
                    fontSize: "15px",
                    fontWeight: "700",
                    borderRadius: "10px",
                    cursor: "pointer",
                    color: "#FFFFFF",
                    backgroundColor: "#05B890",
                    position: "relative",
                    overflow: "hidden",
                    zIndex: "1",
                  }}
                />
              </Grid>
              <Grid container item md={12}>
                <a href="/signup_o">Signup as organization?</a>
              </Grid>
            </Grid>
          </Container>
        </Paper>
      </Grid>
    </Grid>
  );
}
